import { NavLink } from 'react-router-dom';


function Header() {
    return (
        <header >
            <nav>
                <NavLink

                    to="/"
                    className=""
                >
                    Главная
                </NavLink>
                {[
                    ['Главная', '/'],
                    ['Бани', '/bany'],
                    ['Кухня', '/citchen'],
                    ['Массаж', '/massages'],
                    ['Контакты', '/contact']
                ].map(([title, url]) => (
                    <NavLink to="/" className="">{title}</NavLink>
                ))}
            </nav>
        </header>
    );
}

export default Header;
